import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom'; // Ensure you have react-router-dom installed

const Register = () => {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [address, setAddress] = useState('');
  const [password, setPassword] = useState('');
  const [phone, setPhone] = useState('');
  const [gender, setGender] = useState('');
  const [registerMessage, setRegisterMessage] = useState('');

  const navigate = useNavigate(); // Initialize useNavigate hook

  const handleRegister = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:5001/user/register', {
        name,
        email,
        address,
        password,
        phone,
        gender,
      });
      setRegisterMessage(response.data.msg);

      // Store user data in localStorage
      localStorage.setItem('user', JSON.stringify({
        name,
        email,
        address,
        phone,
        gender,
      }));

      // Redirect to login page after successful registration
      navigate('/login'); // Use navigate to redirect
    } catch (error) {
      console.error('Error registering user:', error);
      setRegisterMessage('Registration failed');
    }
  };

  return (
    <div>
      <div className='container'>
      <nav class="navbar navbar-expand-lg navbar-dark" id="navbar">
        <div class="container-fluid" />
        <a class="navbar-brand" href="#home">BOOKS</a>
        <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
          <span class="navbar-toggler-icon"></span>
        </button>
        <div class="collapse navbar-collapse" id="navbarSupportedContent">
          <ul class="navbar-nav me-auto mx-auto ">
            <li class="nav-item">
              <a class="nav-link" href="#home">Home</a>
            </li>
            <li class="nav-item">
              <a class="nav-link" href="#product">Products</a>
            </li>
          </ul>
          <button onClick={() => navigate('/profile')}>Register</button>
          <button onClick={() => navigate('/login')}>Login</button>
        </div>
      </nav>
      <section id="home">
        <h1 class="text-center"> BOOKS REVIEW</h1>
        <p>Application</p>
      </section>
    </div>
      <h2>Register</h2>
      <form onSubmit={handleRegister}>
        <input type="text" placeholder="Name" value={name} onChange={(e) => setName(e.target.value)} required />
        <input type="email" placeholder="Email" value={email} onChange={(e) => setEmail(e.target.value)} required />
        <input type="text" placeholder="Address" value={address} onChange={(e) => setAddress(e.target.value)} />
        <input type="password" placeholder="Password" value={password} onChange={(e) => setPassword(e.target.value)} required />
        <input type="text" placeholder="Phone" value={phone} onChange={(e) => setPhone(e.target.value)} />
        <input type="text" placeholder="Gender" value={gender} onChange={(e) => setGender(e.target.value)} />
        <button type="submit">Register</button>
      </form>
      <p>{registerMessage}</p>
    </div>
  );
};

export default Register;
